import React, { useEffect, useState } from 'react'
import { Container, Table } from 'reactstrap'
import styles from './display.module.css'
import fetchQueue from '../../services/getQueue.ts';
import axios from "axios";

function Display() {
    let data: { key: string, cabinet: number, window: number }[] = [
        { "key": "П100", "cabinet": 110, "window": 1 },
        { "key": "K200", "cabinet": 115, "window": 1 },
        { "key": "П200", "cabinet": 110, "window": 2 }
    ];

    const [queue, setQueue] = useState([]);

    const getQueue = async  () => {
        const response = await fetch('queue');
        console.log(response);
        const bruh = await response.json();
        console.log(bruh);
        //const bruh = await axios.get('/Queue');
        //console.log(bruh);
        //setQueue(data);
    }

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('queue'); // Замените '/queue' на путь к вашему контроллеру на бэкенде
                console.log(response.data);
                setQueue(response.data);
            } catch (error) {
                console.error('Ошибка при загрузке очереди:', error);
            }
        };

        fetchData();
        getQueue();
    }, []);


    const q = queue != undefined ? data.map((d) => {
        return <tr key={d.key}>
            <td>{d.key}</td>
            <td>{d.cabinet}</td>
            <td>{d.window}</td>
        </tr>
    }) : <></>

    return (
        <Container>
            <Container>
                <table className={styles.table}>
                    <thead>
                        <tr>
                            <th>№ талона</th>
                            <th>Кабинет</th>
                            <th>Окно</th>
                        </tr>
                    </thead>
                    <tbody>
                        {q}
                    </tbody>
                </table>
            </Container>
        </Container>
    )
}

export default Display
